package com.voidwhile.system.bean;public class PushExtraBean {	private String uuid;	private String name;	private String photo;	private String consultUuid;	private String consultContent;	public String getUuid() {		return uuid;	}	public void setUuid(String uuid) {		this.uuid = uuid;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public String getPhoto() {		return photo;	}	public void setPhoto(String photo) {		this.photo = photo;	}	public String getConsultUuid() {		return consultUuid;	}	public void setConsultUuid(String consultUuid) {		this.consultUuid = consultUuid;	}	public String getConsultContent() {		return consultContent;	}	public void setConsultContent(String consultContent) {		this.consultContent = consultContent;	}	}